  } ],
  "Sanction Details" : "ON MAY 1, 1992, RESPONDENT ENTERED INTO A CONSENT ORDER WITH THE VT SECURITIES DIVISION IN SETTLEMENT OF THE ALLEGATIONS RAISED IN A NOTICE OF INTENT TO REVOKE BROKER-DEALER AND SECURITIES REGISTRATIONS AND IMPOSE ADMINISTRATIVE SANCTIONS ISSUED ON MAY 1, 1992. IN SETTLEMENT, RESPONDENT HAS, WITHOUT ADMITTING TO OR DENYING ANY VIOLATION OF LAW, AGREED TO JOINTLY AND SEVERALLY PAY A $35,000 FINE AND $15,000 IN INVESTIGATION COSTS. RESPONDENT ALSO AGREED TO CEASE AND DESIST FROM FUTURE VIOLATIONS AND TO CERTAIN RESTITUTION UNDERTAKINGS.",
