  "Initiated By" : "ARIZONA CORPORATION COMMISSION, SECURITIES DIVISION",
  "Allegations" : "ON 2/20/92 THE ARIZONA CORPORATION COMMISSION ENTERED AN ORDER TO CEASE AND DESIST, ORDER OF SUSPENSION OF CERTAIN SALES ACTIVITY AND AN ORDER OF ASSESSMENT CONCERNING FIRST INVESTORS CORPORATION, FIRST INVESTORS FUND FOR INCOME AND FIRST INVESTORS HIGH YIELD FUND. THE TERMS OF THE ORDER INCLUDE A $140,000 ASSESSMENT AND A TWO TIERED PLAN FOR RESTITUTION TO ALL ARIZONA INVESTORS WHO HAD MARKET LOSSES IN THESE TWO FUNDS. MARKET LOSSES HAVE BEEN DETERMINED TO BE APPROXIMATELY $2.3 MILLION. DAVID GRAYSON AND GLENN HEAD, THE PRESIDENT AND CHAIRMAN OF FIC, ARE JOINTLY AND SEVERALLY LIABLE WITH FIC, FIRST INVESTORS CONSOLIDATED CORPORATION AND FIRST INVESTORS MANAGEMENT CORPORATION FOR RESTITUTION TO ARIZONA INVESTORS. IN THE ORDER FIC ALSO CONSENTS TO A MINIMUM 30 DAYS SUSPENSION FROM THE SOLICITATION OF ALL NEW MUTUAL FUND ACCOUNTS AND SALES OF ALL HIGH YIELD INVESTMENT PRODUCTS. FIC AGREED TO CONDUCT NEW TRAINING FOR ALL ARIZONA SALESPEOPLE AND MANAGERS IN THE AREA OF COMPLIANCE WITH THE ARIZONA SECURITIES ACT AND ADDITIONAL TRAINING IN THE AREA OF HIGH YIELD SECURITIES. IF YOU HAVE ANY QUESTIONS PLEASE CALL STEVE MURPHY OR MATT NEUBERT AT THE SECURITIES DIVISION (602) 542-4242.",
